Bringing Up Baby (BBC)

Nature Documentary hosted by David Attenborough, published by BBC broadcasted as part of BBC Natural World series in 2009 - English narration


Information
------------------------------

Natural World investigates the vital bond between animal mothers and their babies. The more we study animals, the more we realise just how emotional they are; all mothers are faced with tough choices as they struggle to bring up babies in a difficult and dangerous world, constantly balancing their own needs with those of their infants. Yet there are many ways to raise your brood, from the fish who looks after her young in her mouth to the extended childhoods of gorillas or orangutans.

